import { Col, Row } from 'antd';

function JobDetails(props) {
  return (
    <>
      <div className="jopOpenings-header">
        <h3>Senior UI/UX Developer </h3>
      </div>

      <Row gutter={[0, 16]}>
        <Col
          xs={{ span: 20, offset: 1 }}
          sm={{ span: 22, offset: 2 }}
          md={{ span: 20, offset: 3 }}
          lg={{ span: 14, offset: 5 }}
        >
          <div className="jopOpenings-title">
           <h3></h3>
          </div>
        </Col>
      </Row>
    </>
  );
}

export default JobDetails;
